import React from "react";
import styled from "styled-components"
import logoUa from "../../images/logoua.png"
import logoEciu from "../../images/logoeciu.png"

const LogUa = styled.img`
height: 46px;
  `


export default () => {

    return (
        <div>
            <LogUa src={logoUa} />

            <LogEciu src={logoEciu} className="w-25" />
        </div>
    )

}
